import axios from 'axios';

export const addBill = state => {
  return axios
    .post('http://localhost:3001/bills', {
      [new Date().toDateString().slice(4)]: { ...state }
    })
    .then(resp => {
      if (resp.status === 201) alert(resp.statusText);
    });
};
